tables.table_schema:
CREATE TABLE users (
    user_id INT,
    age INT,
    gender VARCHAR(10)
);

CREATE TABLE activities (
    activity_id INT,
    user_id INT,
    activity_name VARCHAR(50),
    date DATE
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    age INT,
    gender VARCHAR(10),
    city VARCHAR(50)
);

CREATE TABLE feedback (
    feedback_id INT PRIMARY KEY,
    user_id INT,
    rating INT,
    comments TEXT
);

CREATE TABLE locations (
    location_id INT PRIMARY KEY,
    user_id INT,
    latitude DOUBLE,
    longitude DOUBLE
);
